(function($){ 
    var phone;
    var email;

    function phoneVal(phone) {
        return !isNaN(phone) && phone.length <= 11 && phone.length > 9;
    }
    function emailVal(email) {
        var regex = /^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
        return regex.test(email);
    }
    function checkFieldsEmpty(fields) {
        for (var i in fields) {
            if ( fields[i] !== '' ) {
                return true;
            }
        }
        return false;
    }

    $.fn.formValidation = function(){
        var msgFieldEmpty = 'Vui lng nhp y  thng tin';

        var msgPhoneEmpty = 'Vui lng nhp s in thoi';
        var msgPhoneError = 'S in thoi cha ng';

        var msgEmailEmpty = 'Vui lng nhp email';
        var msgEmailError = 'Email cha ng';

        var _this = this;

        _this.msgError = [];
        _this.status = {};
        _this.fields = {};

        var phoneSeletor = $(_this).find('input[type="phone"]');
        var emailSeletor = $(_this).find('input[type="email"]');

        /*  
            Validation phone
        */

        /*
            Checking phone, email
        */
        this.checking = $(this).submit(function(){            
            var allValue = [];
            var selectorFields = $(_this).find('[field]');
            
            selectorFields.each(function(){
                allValue.push($(this).val());
            });

            var fieldsEmpty = checkFieldsEmpty(allValue); // Return true or false;

            if ( fieldsEmpty !== false ) { 
                /*
                    // Form Not Empty.
                */

                _this.status.empty = false; // Form Not Empty 

                if (phoneSeletor.length > 0) {
                    var phoneValue = phoneSeletor.val();
    
                    if (phoneValue === '') {
                        _this.msgError.push(msgPhoneEmpty);
                        _this.status.phone = false;
                    }else {
                        if (phoneVal(phoneValue)) {
                            _this.status.phone = true;
                        }else {
                            _this.status.phone = false;
                            _this.msgError.phone = msgPhoneError;
                        }
                    }
                }
    
                if (emailSeletor.length > 0) {
                    var emailValue = emailSeletor.val();

                    if (emailValue === '') {
                        _this.msgError.push(msgEmailEmpty);
                        _this.status.email = false;
                    }else {
                        if (emailVal(emailValue)) {
                            _this.status.email = true;
                        }else {
                            _this.status.email = false;
                            _this.msgError.email = msgEmailError;
                        }
                    }
                }
            }else {
                _this.status.empty = true; // Form Empty 
                _this.msgError.empty = msgEmailError;
            }
            
            console.log(_this);
        });

        return this;
    };
})(jQuery);


